// Header.js

import React from 'react';

const Header = () => {
  return (
    <nav className="bg-black p-4">
      <div className="container mx-auto flex items-center justify-between">
        <div>
          <img src="https://via.placeholder.com/150" alt="Logo" className="h-12 w-auto" />
        </div>
        <div>
          <ul className="flex space-x-4 text-white">
            <li><a href="/" className="hover:text-gray-300">Home</a></li>
            <li><a href="/movies" className="hover:text-gray-300">Movies</a></li>
            <li><a href="/series" className="hover:text-gray-300">Series</a></li>
            <li><a href="/genres" className="hover:text-gray-300">Genres</a></li>
            <li><a href="/search" className="hover:text-gray-300">Search</a></li>
          </ul>
        </div>
      </div>
    </nav>
  );
}

export default Header;
